import './App.css';

function App() {
	return (
		<div className='App'>
			<header className='App-header'>  
				<p> Hello there </p>
				<button onClick={() => window.location.href="crap.js"}> Click me! </button>	
			</header>
		</div>
	);
}

export default App;
